import React from "react";
import { View,Text,Image,TextInput,TouchableOpacity,ImageBackground} from "react-native";
import { MaterialIcons } from "@expo/vector-icons";



const LogIn=() =>{
    return(
        <View>
            <Text>Welcome Back, sign in to continue!</Text>
        </View>
    )
} 
export default Log
